import "./TopBar.css";
import logoImage from "../Obrazky/obrazok2.jpg";
import logoImage2 from "../Obrazky/logo.png";
import { useState } from "react";

const TopBar = () => {

    const[Image,setImage] = useState(logoImage);

    const changeImage = () => {

        setImage(logoImage2)
    }

    return(
        <div>
            <button onClick={changeImage}>DREAM CRUISE</button>
            <img src={Image} alt="Logo" />
        </div>

    )
}

export default TopBar;

